import React from 'react';
import {
  BrowserRouter as Router,
  Route,
  Link,
} from 'react-router-dom';

class App extends React.Component{

    render(){
    return(

    <Router>
    <div>
      <header>Search Pictures</header>
      <nav>
        <Link>Search</Link>
        <Link>Favorites</Link>
      </nav>
      </div>
      </Router>
    )
}
}
export default App;
